import { Algorithm } from "./algorithm_interface";
import {BinaryTree} from "../structures/binary_tree";
import {AnimatedTree} from "../animations/tree_animation";
import React, {useState} from "react";

export class MinHeap implements Algorithm {
    tree: BinaryTree;
    setValues: React.Dispatch<React.SetStateAction<(string | number)[]>>;

    constructor() {
        this.tree = new BinaryTree();

        const [values, setValues] = useState<(string | number)[]>([]);
        this.setValues = setValues;
    }

    insert(value: number | string) {
        this.tree.add(value);
    }

    display(): JSX.Element {

        return (
            <svg width="500" height="500">
                <AnimatedTree values={this.tree.values} />
            </svg>
        );
    }
}
